import React, { useEffect, useState } from 'react'

export default ()=>{
    const [lista,setLista] = useState([]);

    useEffect(()=>{
        getData();
    },[]);

    const getData = async () =>{
        const res = await fetch('http://localhost:8080/api/getUsuarios/');
        console.log('res=> ',res);
        const {data=[] } = res.json();
        console.log(data);
        setLista(data); 
    }

    return <div>
        <h3>Usuarios</h3>
        <hr/>
        <ol>
            {
            lista.map(e=><li key={e.id}>
               <p> {`${e.nombre} ${e.apeido} `} </p>
            <b>{e.fecha_alta}</b>
            </li>)
            }
        </ol>
    </div>
}
